    return (
      <div>
        <div className="opis1">
          Lorem ipsum dolor, sit amet consectetur adipisicing elit. Voluptate
          recusandae corrupti qui nisi maxime. Incidunt corrupti aliquid,
          repudiandae inventore velit fugiat expedita repellendus adipisci
          necessitatibus dolor sint, explicabo laboriosam
        </div>
      </div>
    );
  }
}

export default Index_description1;
